import React from "react";
import classes from "./Header.module.css";

import Button from "../UI/Button/Button";

const Header = (props) => {
  const fetchHandler = (event)=>{
    event.preventDefault();
    const data = {
      id:props.id,
      title:props.title,
      author:props.author,
      album:props.album
    }
    props.onFetch(data)
  }

  return (
    <div className={classes.header}>
      <div className={classes["search-header"]}>
        <Button onClick = {fetchHandler} id="kpop"></Button>
        <Button onClick = {fetchHandler} id="openings"></Button>
        <Button onClick = {fetchHandler} id="jpop"></Button>
        <Button onClick = {fetchHandler} id="vgames"></Button>
      </div>
      <div className={classes["user-header"]}>
        <Button ></Button>
        <Button ></Button>
      </div>
    </div>
  );
};

export default Header;
